const items = $input.all();
const updatedItems = items.map((item) => {
  const cityName = item?.json?.Timezone.split("/")[1]?.replace("_", " ")?.split(" (")[0];
  item.json.City = cityName;
  return item;
});
return updatedItems;

const data = items[0].json.list; // Grab the forecast list from the first item
const output = [];

for (const forecast of data) {
  if (!forecast.dt_txt) continue; // Skip if missing

  const dtTxt = forecast.dt_txt;
  const dtTime = dtTxt.split(" ")[1]; // Extract "00:00:00"

  forecast.dt_time = dtTime;

  if (dtTime === "00:00:00" || dtTime === "09:00:00") {
    output.push({ json: forecast });
  }
}

return output;

// Assume you're getting a list of hourly forecasts in items[0].json.forecast.forecastday[0].hour, etc.
const forecastDays = items[0].json.forecast.forecastday;
const output = [];

for (const day of forecastDays) {
  for (const hour of day.hour) {
    if (!hour.time) continue;

    const dtTime = hour.time.split(" ")[1]; // Extract "HH:MM"

    hour.dt_time = dtTime;

    if (dtTime === "00:00" || dtTime === "09:00") {
      output.push({ json: hour });
    }
  }
}

return output;

