for (const item of items) {
  const forecast = item.json;

  // Skip if time is missing (no valid timestamp)
  if (!forecast.time) continue;

  const dtTime = forecast.time.split(" ")[1]; // "00:00", "09:00", etc.

  // Only process 00:00 or 09:00 timestamps
  if (dtTime === "00:00" || dtTime === "09:00") {
