const items = $input.all();
const updatedItems = items.map((item) => {
  const { temp, ...rest } = item.json; // Destructure to extract temp and keep the rest
  return {
    ...item,
    json: {
      ...rest,
      temp_opw: temp, // Rename temp to temp_opw
    },
  };
});
return updatedItems;

for (const item of $input.all()) {
  item.json.time = item.json.time + ":00"; // "2025-06-01 00:00:00"
}
return $input.all();

const now = new Date();
const today = now.toISOString().split('T')[0];

// Filter data for today + next 2 days
const relevantData = $input.all().filter(item => {
  const itemDate = item.json.dt_txt.split(' ')[0];
  const itemDateTime = new Date(itemDate);
  const daysDiff = Math.floor((itemDateTime - new Date(today)) / (1000 * 60 * 60 * 24));
  return daysDiff >= 0 && daysDiff <= 2;
});

// Group by date AND time
const processedData = relevantData.map(item => {
  const date = item.json.dt_txt.split(' ')[0];
  const time = item.json.dt_txt.split(' ')[1];
  const runType = time === "00:00:00" ? "midnight" : "morning";

  return {
    Date: date,
    "Dhaka forecast API_1 (degrees in Celsius)": item.json.temp_opw !== "N/A" ? Math.round(item.json.temp_opw) + "°" : "N/A",
    "Dhaka forecast API_2 (degrees in Celsius)": item.json.temp !== "N/A" ? Math.round(item.json.temp) + "°" : "N/A",
    run_type: runType
  };
});

return processedData;
